      out.write("        <h2>Problem</h2>\n");
      out.write("        <p>The electric vehicle (EV) revolution is accelerating at an incredible pace, but it?s facing major speed bumps - the charging station availability crisis. Finding available EV chargers is the fastest growing problem for EV owners, especially the +800k drivers in California where the rate of new vehicles doubles that of new chargers.</p>\n");
