      out.write("        <h2>Model</h2>\n");
      out.write("        <p>We evaluated 3 models for predicting charger availability: Linear, Gradient-boosted Trees, and LSTM. We ultimately selected the LSTM neural network for its superior ability to learn from temporal sequences of data and handle non-linearity, even though it required significantly more training time.</p>\n");
      out.write("      \n");
      out.write("        <h2>Evaluation</h2>\n");
